import React from "react";
import styled from "styled-components";
import DiceRollResults from "../Logic/DiceRollResults";

const Container = styled.div`
  width: 95%;
  margin: 0 auto;
  margin-top: 35px;
  background-color: #fff;
  border: 3px solid #662d91;
`;

const CountContainer = styled.div`
  margin: 0 auto;
  width: 50%;
  display: flex;
`;

const RollInfoDisplay = (props) => {
  return (
    <Container>
      <p>Number Rolls</p>
      <CountContainer>
        <p>D4: {DiceRollResults.D4.length}</p>
        <br />
        <p>D6: {DiceRollResults.D6.length}</p>
        <p>D8: {DiceRollResults.D8.length}</p>
        <p>D12: {DiceRollResults.D12.length}</p>
        <p>D20: {DiceRollResults.D20.length}</p>
      </CountContainer>
    </Container>
  );
};

export default RollInfoDisplay;
